import { TextField, Box, Typography } from "@mui/material";
import React from "react";

const DataTypes = ["double", "vector<double>", "String"];
const Buttons = ["System", "P", "M", "W", "Q", "R", "RoH", "RoL"];

export default function Scenario() {

    return (
        <Box sx={{ width: "100%", pt: 2, pl: 2 }}>
            <Box >
                <TextField id="system" label={DataTypes[2]} variant="standard" helperText="System name" />
            </Box>

            <TextField id="p" label={Buttons[1]} variant="standard" />
            <TextField id="m" label={Buttons[2]} variant="standard" />
            <TextField id="w" label={Buttons[3]} variant="standard" />
            <TextField id="q" label={Buttons[4]} variant="standard" />


        </Box>


    );
}
